import React, { useState } from 'react';

function App() {
  // 定义状态用于存储 token
  const [token, setToken] = useState(null);

  // 点击事件处理函数
  const handleClick = async () => {
    try {
      // 发起网络请求获取 token（替换为实际 URL）
      const response = await fetch('http://220.88.39.23:5000/api/user/token?username=test123');
      if (!response.ok) {
        throw new Error('网络请求失败');
      }
      const data = await response.json();
      // 假设 data 中包含 token 字段
      setToken(data.token);
    } catch (error) {
      console.error('请求错误:', error);
    }
  };

  return (
    <div>
      <button onClick={handleClick}>获取 Token</button>

      <div>
        <h3>获取到的 Token：</h3>
        {token ? <p>{token}</p> : <p>尚未获取 Token</p>}
      </div>
    </div>
  );
}

export default App;
